- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    employs a full time Executive Director, whose time is more than 25 percent devoted
    to federal elections and candidates.  No other entity pays compensation for their
    employees to work for the committee. The Fairfax County Democratic Committee maintains
    both Federal and Non Federal accounts. Although the Committee has been allocating
    qualified joint administrative expenses on the 36 percent Federal 64 percent Non
    Federal split, the funds in our Non Federal account are inadequate to transfer
    to the Federal Account for disbursements after October 1, 2008.  This report has
    been amended to remove split (allocated) expenses, as no transfer is possible
    until the Non Federal account is replenished with adequate funds. Administrative
    expenses will be paid 100 percent with Federal account funds until the Non Federal
    account has a higher balance. The Committee does not engage in any fundraising
    on behalf of candidates for Federal office, so all of its reported fundraising
    expenses are party fundraising. The main purpose of this amendment is to align
    the corrected cumulative balance with the previously amended monthly reports for
    2008. In addition, certain disbursements have been restated to clarify purposes
    of the expenses or to correct errors in original or amended classifications.\n"
